let FacesService = {};

FacesService.generateFace = function () {
 // const briefcase3 = png3x(enums.FaceSvgPaths.SAD, enums.FaceColors.SAD);
 // const briefcase4 = png3x(enums.FaceSvgPaths.SAD, enums.FaceColors.NONE);
};

FacesService.getFace = function (type, color) {
  for (const face of faces) {
    if (face.type === type && face.color === color) {
      return face.png;
    }
  }

  return '';
};

FacesService.getAnimal = function (type) {
  for (const face of faces) {
    if (face.type === type) {
      return face.png;
    }
  }

  return '';
};

module.exports = FacesService;
